import React from 'react';
import { NavLink } from 'react-router-dom';


const Signedoutlinks = () => {
    return (
   <ul className="right">
       <li> <NavLink to='/'> Sign up</NavLink></li>
       <li> <NavLink to='/'> Login</NavLink></li>



   </ul>
    );
};
export default Signedoutlinks;
